import React, { useState, useEffect }  from "react";
import ReactDOM from "react-dom";

import './index.css';

const GetData = () => {
  const [tracks, setQuotes] = useState(null)
  useEffect(() => {
    fetch("http://localhost:3030/api/getall")
      .then((results) => {
        return results.json();
      })
      .then((data) => {
        console.log(data.tracks)
        setQuotes(data.tracks)
      });
  }, [])

  return (
    <> 
      {
        tracks ?
          <QuoteArray tracks={tracks} />
          : <div>Nothing here.Fething data...</div>
      }
    </> // fragmenttien lopetustägi
  );
}



const QuoteArray = (props) => {
  const { data } = props;

  return (
    <div>
      <ul>
        {data.map((item) => (
          <li>
            {item.name} ( {item.year} )
          </li>
        ))}
      </ul>
    </div>
  );
};





ReactDOM.render(<GetData />, document.getElementById("root"));
